Each criteria has an associated test, but we need to tell our program which test goes with which criteria. After we've written our tests and loaded our rubric, we can use the attach! macro to assign them. Just point the criteria's stub that you specified in the .yml file to the function name. fn my_criteria_test(_: &TestData) -> bool { // test code goes here... return true;
} fn main() { // load rubric // code omitted // be sure it's mutable let mut rubric = //... attach! { rubric, "criteria-stub" => my_criteria_test };
}

