Tests are just functions, but they must have a specific signature. They must always accept the same parameters and return the same type of value. Here's the signature // Be sure TestData is imported
use rubric::TestData; fn my_test(data: &TestData) -> bool { // Test code goes here...
} Every test must accept a reference to a TestData struct. This TestData is stored on a Submission , which I'll cover in a different section. What you should know now is that it's an alias to HashMap<String, String>. Sometimes you won't need TestData in a test, in which case you can just name the parameter _ and Rust won't complain. Tests must also return a boolean. true if it passes, false otherwise. If a test returns true, then the associated criteria's worth will be added to the point total. If all the criteria tests return true, the maximum score is achieved.
